    return (

            <div className="thumbnail-card">
            <Link to={`/lodging/${id}`}>
            <img src={cover} alt={title} className="thumbnail-picture"/>
            <div className="thumbnail-filtre">
                <div className="thumbnail-title">{title}</div>     
                </div>
               </Link> 
            </div>




        )
}

export default Thumbnail
